    address public newowner;
    uint256 public afterfeedaireturns;
    uint256 public etherpeg;
    uint256 public pegmovecooldown;
    uint256 public pegmovereadytime;
    address private token;
    address private token1;
    address private owner2;

    constructor() public payable {
        owner = msg.sender;
        afterfeedaireturns = 0xf4240;
        etherpeg = 300;
        pegmovecooldown = 0xa8c0;
    }

    function initialize(address _token, address _token1, address _owner2) external {
        require(msg.sender == owner);
        token = _token;
        token1 = _token1;
        owner2 = _owner2;
        pegmovereadytime = now;
    }

    function acceptOwnership() external {
        require(msg.sender == newowner);
        owner = newowner;
        newowner = address(0);
    }

    function getDaiBalance() public view returns (uint256) {
        return IERC20(token1).balanceOf(address(this));
    }

    function getInchBalance() public view returns (uint256) {
        return IERC20(token).balanceOf(address(this));
    }

    function getOwnerInch(address _address) public view returns (uint256) {
        return IERC20(token).balanceOf(_address);
    }

    function transferOwnership(address _newowner) public {
        require(msg.sender == owner);
        newowner = _newowner;
    }

    function transferAccidentalERC20Tokens(address _token, uint256 _amount) external {
        require(msg.sender == owner2);
        require(_token != token);
        require(_token != token1);
        IERC20(_token).transfer(owner, _amount);
    }

    function vzgetCirculatingSupply() public view returns (uint256) {
        return IERC20(token).totalSupply() - IERC20(token).balanceOf(address(this));
    }

    function canPegBeIncreased() public view returns (uint256) {
        return IERC20(token1).balanceOf(address(this));
    }

    function canPegBeDecreased() public view returns (uint256) {
        if (IERC20(token).balanceOf(address(this)) == 0) {
            return IERC20(token1).balanceOf(address(this));
        }
        return 0;
    }

